import React, { useEffect, useState } from 'react';
import SimpleImageSlider from 'react-simple-image-slider';
import axios from 'axios';

const ImageSlider = () => {
	useEffect(() => {
		// console.log(loadRecipe.resolve('images'));
		console.log(loadRecipe());
	}, []);
	const [loadedImages, setLoadedImages] = useState([]);
	const currentUrl = window.location.href;
	const recipe_id = currentUrl.substring(currentUrl.lastIndexOf('/') + 1);
	const RECIPE_URL = 'http://127.0.0.1:8000/api/recipes/' + recipe_id;
	const loadRecipe = async () => {
		try {
			const response = await axios.get(RECIPE_URL);
			if (response) {
				const images = response.data[0].images.map((item) => item.image);
				// setLoadedImages(images);
				return { images: images };
			}
		} catch {
			console.log('failed to load recipe');
		}
	};
	const images = [
		'"data:image/jpeg;base64,"',
		'"data:image/jpeg;base64,"',
	];
	return (
		<div>
			<SimpleImageSlider
				width={300}
				height={200}
				images={images}
				showBullets={true}
				showNavs={true}
			/>
		</div>
	);
};

export default ImageSlider;
